INSERT INTO `carservice_dynamic` VALUES ('1634071823845036032','154','大家好','[]',2,124,28,0,'2023-03-10 14:00:57','2023-03-16 13:18:10',1,'0',354),('1636238412195434496','154','环境永远不会十全十美，消极的人受环境控制，积极的人却控制环境。','[]',0,63,0,0,'2023-03-16 13:30:12','2023-04-29 07:49:50',0,'0',2),('1636238468323610624','154','别人可以违背因果，别人可以害我们，打我们，毁谤我们。可是我们不能因此而憎恨别人，为什么？我们一定要保有一颗完整的本性和一颗清净的心。','[]',1,65,0,0,'2023-03-16 13:30:25','2023-04-29 07:49:50',0,'0',1),('1636238510321176576','154','没有比脚更远的路，没有比人更高的山!','[]',0,63,0,0,'2023-03-16 13:30:35','2023-04-29 07:49:50',0,'0',2),('1636239902712664064','154','多一分心力去注意别人，就少一分心力反省自己，你懂吗？','[]',1,62,0,0,'2023-03-16 13:36:07','2023-04-29 07:49:50',0,'0',1),('1636412009488715776','0000000000','你怎么长得跟个二维码似的，不扫一下，都不知道你是什么东西！','[]',0,53,3,0,'2023-03-17 01:00:01','2023-05-05 20:49:04',0,'0',0),('1636774396586758144','0000000000','什么都在涨价，就是人越来越贱。','[]',0,40,0,0,'2023-03-18 01:00:01','2023-05-05 20:49:04',0,'0',0),('1637136784624324608','0000000000','无论我们最后生疏成什么样子，曾经对你的好都是真的。就算终有一散，也别辜负相遇。希望你不后悔认识我，也是真的快乐过。如果能回到从前，我会选择不认识你，不是我后悔，是我不能面对现在的结局','[]',0,27,0,0,'2023-03-19 01:00:01','2023-05-05 20:49:04',0,'0',0),('1637499172871606272','0000000000','将薪比薪的想了想，算了，不想活了。','[]',0,29,0,0,'2023-03-20 01:00:01','2023-05-05 20:49:04',0,'0',0),('1637861560208723968','0000000000','每次临时抱佛脚的时候，佛总是给我一脚。','[]',0,27,0,0,'2023-03-21 01:00:01','2023-05-05 20:49:04',0,'0',0),('1638223948346953728','0000000000','你现在所拥有的，都不曾是你的，因为未来你都会失去。','[]',0,27,0,0,'2023-03-22 01:00:01','2023-05-05 20:49:04',0,'0',0),('1638586336288051200','0000000000','单身脱发又没钱，跑步进入中老年。','[]',0,28,0,0,'2023-03-23 01:00:01','2023-05-05 20:49:04',0,'0',0),('1638948724057182208','0000000000','我也曾青春逼人，可惜现在青春没了，就剩这么个逼人了。','[]',0,26,0,0,'2023-03-24 01:00:01','2023-05-05 20:49:04',0,'0',0),('1639311112522567680','0000000000','你现在所拥有的，都不曾是你的，因为未来你都会失去。','[]',0,25,0,0,'2023-03-25 01:00:01','2023-05-05 20:49:04',0,'0',0),('1639673500073594880','0000000000','你要么非常努力，要么非常聪明，才能勉强过上平庸的生活。','[]',0,26,0,0,'2023-03-26 01:00:01','2023-05-05 20:49:04',0,'0',0),('1640035887100334080','0000000000','女票突然变瘦了，多半是漏气了。','[]',0,23,0,0,'2023-03-27 01:00:01','2023-05-05 20:49:03',0,'0',0),('1640398275179843584','0000000000','他喜欢你素颜，必须是素颜好看。','[]',0,24,0,0,'2023-03-28 01:00:01','2023-05-05 20:49:03',0,'0',0),('1640760663557148672','0000000000','为什么你能像智障一样活着，而我却不可以。','[]',0,26,0,0,'2023-03-29 01:00:01','2023-05-07 23:24:12',0,'0',0),('1641123052710400000','0000000000','眼睛千万不要对着手机太久，专家说了，那样手机会没电。','[]',2,31,0,0,'2023-03-30 01:00:01','2023-05-07 23:24:12',0,'0',2),('1641485439212851200','0000000000','愿你以后，有酒有肉有姑娘，姑娘丑的不像样。','[]',2,34,0,0,'2023-03-31 01:00:01','2023-05-07 23:24:12',0,'0',2),('1641847827296555008','0000000000','喜欢就去表白，不然你不会知道自己长得多丑。','[]',2,31,0,0,'2023-04-01 01:00:01','2023-05-07 23:24:18',0,'0',6),('1642210214847582208','0000000000','我觉得一定有很多人暗恋我，因为这么多年了，也没有人跟我表白！','[]',1,32,0,0,'2023-04-02 01:00:01','2023-05-07 23:24:12',0,'0',3),('1642572603304579072','0000000000','你知道投资和投机的区别吗？一个是普通话，一个是广东话。','[]',1,35,0,0,'2023-04-03 01:00:01','2023-05-07 23:24:12',0,'0',3),('1642934990067077120','0000000000','很多时候，乐观的态度和好听的话帮不了你。','[]',2,36,0,0,'2023-04-04 01:00:01','2023-05-07 23:24:12',0,'0',2),('1643297377861373952','0000000000','凡是不赚钱的，都说自己在创业。','[]',2,35,0,0,'2023-04-05 01:00:01','2023-05-07 23:24:12',0,'0',2),('1643659766125432832','0000000000','不为无益之事，何以遣有涯之生？','[]',2,37,0,0,'2023-04-06 01:00:01','2023-05-07 23:24:12',0,'0',2),('1644022153902952448','0000000000','指甲不小心劈开了','[]',0,36,0,0,'2023-04-07 01:00:01','2023-05-07 23:24:11',0,'0',2),('1644384543257530368','0000000000','一路上有你，苦一点也愿意，苦很多免谈。','[]',2,36,0,0,'2023-04-08 01:00:01','2023-05-07 23:24:10',0,'0',2),('1644746928904343552','0000000000','骑电动车请戴好头盔，否则，开奔驰的同学会认出你。','[]',0,26,2,0,'2023-04-09 01:00:00','2023-05-07 23:24:10',0,'0',0),('1645109317780770816','0000000000','每天都要有新的期待，这样才能有新的失望。','[]',0,20,0,0,'2023-04-10 01:00:01','2023-05-07 23:24:10',0,'0',0),('1645471706241961984','0000000000','就算睡得晚，不会找你的人还是不会找你！','[]',0,20,0,0,'2023-04-11 01:00:01','2023-05-07 23:24:10',0,'0',0),('1645834093541330944','0000000000','人家谈恋爱，靠长相靠浪漫靠烧钱，而你靠对方眼瞎。','[]',0,20,0,0,'2023-04-12 01:00:01','2023-06-19 19:52:34',0,'0',1),('1646196481033637888','0000000000','2023年第一天，说出你的新年愿望，那就一定不会实现。','[]',0,18,0,0,'2023-04-13 01:00:01','2023-06-19 19:52:34',0,'0',1),('1646558868207177728','0000000000','时间就像胸，挤挤就有了，躺下就没了。','[]',0,18,0,0,'2023-04-14 01:00:00','2023-06-19 19:52:34',0,'0',1),('1646921256907444224','0000000000','每次临时抱佛脚的时候，佛总是给我一脚。','[]',0,18,0,0,'2023-04-15 01:00:01','2023-06-19 19:52:34',0,'0',1),('1647283645557379072','0000000000','机会是留给有准备的人，没机会的人，就别瞎准备了。','[]',0,17,0,0,'2023-04-16 01:00:01','2023-06-19 19:52:34',0,'0',1),('1647646032202436608','0000000000','你不奋斗一下？怎么知道自己有多无能。','[]',0,16,0,0,'2023-04-17 01:00:01','2023-06-19 19:52:34',0,'0',1),('1648008420382609408','0000000000','看见一个算命大师，我刚坐下他就问我，你算什么东西？','[]',0,15,0,0,'2023-04-18 01:00:01','2023-06-19 19:52:34',0,'0',1),('1648370808017522688','0000000000','最怕你一生碌碌无为，还安慰自己说平凡可贵。','[]',0,16,0,0,'2023-04-19 01:00:01','2023-06-19 19:52:34',0,'0',1),('1648733196554211328','0000000000','不要把银行卡密码，设成女朋友的生日，不然总要换多麻烦。','[]',0,20,0,0,'2023-04-20 01:00:01','2023-06-27 21:31:07',0,'0',5),('1649095584386256896','0000000000','趁着年轻多出来走走，不然你不会知道，呆在家里有多爽。','[]',0,20,0,0,'2023-04-21 01:00:01','2023-06-27 21:31:07',0,'0',5),('1649457971987615744','0000000000','生活不是这样就是那样，总之，不会是你想的那样。','[]',0,20,0,0,'2023-04-22 01:00:01','2023-06-27 21:31:07',0,'0',5),('1649820360276840448','0000000000','三百六十行，行行出BUG。','[]',0,19,0,0,'2023-04-23 01:00:01','2023-06-27 21:31:07',0,'0',5),('1650182747978862592','0000000000','骑白马的不一定是王子，也可能会是是唐僧！','[]',0,20,0,0,'2023-04-24 01:00:01','2023-06-27 21:31:07',0,'0',5),('1650545135819296768','0000000000','国庆去哪看风景最好？答案是，朋友圈。','[]',0,20,0,0,'2023-04-25 01:00:01','2023-06-27 21:31:07',0,'0',5),('1650907523647148032','0000000000','除了是处，一无是处。','[]',0,24,1,0,'2023-04-26 01:00:01','2023-06-27 21:31:07',0,'0',6),('1651269911269478400','0000000000','加我回来吧，我给你发我的婚礼请柬。','[]',0,25,0,0,'2023-04-27 01:00:01','2023-06-27 21:31:07',0,'0',6),('1651632299361570816','0000000000','很久不开QQ，登录后才发现，原来只有腾讯新闻在乎你。','[]',0,48,0,0,'2023-04-28 01:00:01','2023-06-27 21:31:07',0,'0',6),('1651994687076175872','0000000000','谈钱伤感情，谈感情伤钱。','[]',0,53,0,0,'2023-04-29 01:00:01','2023-06-27 21:31:07',0,'0',12),('1652357075055022080','0000000000','没有谁的生活会一直完美\n但不论什么时候\n都要看向前方\n满怀希望才能所向披靡','[]',0,51,0,0,'2023-04-30 01:00:01','2023-06-27 21:31:00',0,'0',12),('1652719463528796160','0000000000','虽然你学的慢，但是你，放弃的快呀。','[]',0,52,0,0,'2023-05-01 01:00:01','2023-06-27 21:31:00',0,'0',13),('1653081850501009408','0000000000','有时候，真的很难受。为什么自己怎么丧？','[]',0,61,0,0,'2023-05-02 01:00:01','2023-06-27 21:31:00',0,'0',23),('1653444238492438528','0000000000','你说冰是睡着的水，我只记得屁是屎的叹息。','[]',0,63,0,0,'2023-05-03 01:00:01','2023-06-27 21:31:00',0,'0',26),('1653806627956068352','0000000000','世界这么大 我想去看看。钱包那么小 你能走多远？','[]',0,70,0,0,'2023-05-04 01:00:01','2023-06-27 21:31:00',0,'0',35),('1654169014844395520','0000000000','钱买不来快乐，那一定是，你的钱太少了！','[]',0,70,0,0,'2023-05-05 01:00:01','2023-06-27 21:31:00',0,'0',36),('1654531402655469568','0000000000','我是一条酸菜鱼，又酸又菜，还多余。','[]',1,69,0,0,'2023-05-06 01:00:01','2023-06-27 21:31:00',0,'0',44),('1654893790202302464','0000000000','早起的虫儿被鸟吃，早起的鸟儿有虫吃。','[]',1,79,14,0,'2023-05-07 01:00:01','2023-06-27 21:31:00',0,'0',73),('1659926863616806912','154','123','[]',0,54,0,0,'2023-05-20 22:19:39','2023-06-27 21:31:00',0,'0',54),('1669751692947755008','0000000000','面试的时候，他们叫你去聊聊，真的只是去聊聊。','[]',0,52,0,0,'2023-06-17 01:00:01','2023-06-27 21:31:00',0,'0',52),('1670114080062574592','0000000000','你人人称道的美丽，里面都有PS的痕迹。','[]',0,53,0,0,'2023-06-18 01:00:01','2023-06-27 23:46:57',0,'0',53),('1670476468074975232','0000000000','骑电动车请戴好头盔，否则，开奔驰的同学会认出你。','[]',0,53,0,0,'2023-06-19 01:00:01','2023-06-28 11:52:17',0,'0',53),('1670838856083181568','0000000000','穿白色衣服上班，并不代表你可以不背黑锅。','[]',0,43,0,0,'2023-06-20 01:00:01','2023-06-29 14:25:10',0,'0',43),('1671201244280131584','0000000000','友谊是什么？你智障多年，我不离不弃。','[]',0,40,0,0,'2023-06-21 01:00:01','2023-06-29 14:25:10',0,'0',40),('1671563633575989248','0000000000','可怕的不是，别人在今天忽悠你，而是忘了你这个人。','[]',0,31,0,0,'2023-06-22 01:00:01','2023-06-29 14:25:10',0,'0',31),('1671926019893891072','0000000000','你多努力一点，获得的打击就多一点。','[]',0,30,0,0,'2023-06-23 01:00:01','2023-06-29 14:25:10',0,'0',30),('1672288407717548032','0000000000','以前除了读书什么都不懂，现在除了读书什么都懂。','[]',0,24,0,0,'2023-06-24 01:00:01','2023-06-29 14:25:10',0,'0',24),('1672650796581392384','0000000000','我这人不太懂音乐，所以时而不靠谱，时而不着调。','[]',0,13,0,0,'2023-06-25 01:00:01','2023-06-29 14:25:10',0,'0',13),('1673013183180312576','0000000000','也许命运扼住你的咽喉，只是让你少吃两口。','[]',0,11,0,0,'2023-06-26 01:00:01','2023-06-29 14:25:10',0,'0',11),('1673375571029135360','0000000000','朋友说借二十块钱回头给你，借完钱之后我才知道，有些人一转身就是一辈子。','[]',0,7,0,0,'2023-06-27 01:00:01','2023-06-29 14:25:10',0,'0',7),('1673737959452577792','0000000000','我没有去过你的城市，但我刷过你那的题。','[]',0,2,0,0,'2023-06-28 01:00:01','2023-06-29 14:25:10',0,'0',2),('1674100347729219584','0000000000','喜欢就去表白，不然你不会知道自己长得多丑。','[]',0,1,0,0,'2023-06-29 01:00:01','2023-06-29 14:25:10',0,'0',1);
