INSERT INTO `carservice_issue` VALUES ('2','商品如何发货？','1.下单后系统会通知店家24小时内送货上门。如24小时内未送货上门，可随时申请退款，退款金额将原路返回。','2018-02-01 00:00:00','2022-08-13 14:37:33',0,'0',2),('3','何时确认收货？','1.待商家送货上门后仔细检验交易物品无误后可手动确认收货，也可等7日后订单自动确认收货，PS：如商家发货后未及时发货，请及时申请退款。','2018-02-01 00:00:00','2022-08-13 14:34:37',0,'0',4),('4','申请退款长时间未确认怎么办？','1.订单申请退款，需店家手动确认退款。如发现长时间未退款（一天以上），请及时联系平台管理员，提供相应证据，手动退款。','2018-02-01 00:00:00','2022-08-13 14:56:19',0,'0',3),('5','如何成为店家？','1.点击底部导航栏（小店-->我的店铺）填写相应信息即可成为店主。','2022-08-13 15:01:32','2022-08-13 15:01:32',0,'0',0),('6','如何发布商品？','1.成为店主后到（小店-->发布商品）填写商品相应信息，商品提交发布后会在一个工作日内审核完成并自动发布。注：商品真实交易金额为货品库存内的金额，商品金额限制（1元~1000元）金额超过后无法打款。','2022-08-13 15:06:04','2022-08-13 15:06:57',0,'0',3),('7','商品交易准则','1.店家收到订单通知，24小时内及时送货上门。\n2.送货上门前请先和用户沟通准许后，再送货上门。\n3.用户觉得物品不满意请及时退款，不得强制拖延时间。','2022-08-14 11:54:57','2022-08-14 11:54:57',0,'0',0),('8','如何获得商品出售金额？','1.商品出售后，用户点击确认收货，系统会自动将商品出售金额，转到店家微信零钱。\n2.如发货后用户忘记点击确认收货，系统也会在七天后自动确认收货，并转账。','2022-08-14 12:56:03','2022-08-14 12:56:03',0,'0',0);
/*!40000 ALTER TABLE `carservice_issue` ENABLE KEYS */;
